('The Digital World and Society', 'CMPE025', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The secure, effective and ethical use of information technology. The effect of such technology on people and institutions. Technology-related challenges to society and policy. Frameworks for the analysis of information technology with respect to its cultural, historical, environmental, and spatial contexts. GE Area: D1'),
('Programming Concepts and Methodology', 'CMPE030', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to programming; overview of computer organization and introduction to software engineering. Topics include methodologies for program design, development, style, testing, and documentation; algorithms, control structures, functions, and elementary data structures. Corequisites: MATH 030 or equivalent. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Object-Oriented Concepts and Methodology', 'CMPE050', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Application of object-oriented software engineering techniques to the design and development of larger programs; data abstraction, structures, classes and associated algorithms. Prerequisite: CMPE 030 with a minimum grade of "C-". Computer Engineering and Software Engineering Majors only. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Programming Concepts and Problem Solving', 'CMPE101', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Develop skills and proficiency in the design and implementation of solutions to computer engineering problems using structured and objective-oriented programming techniques using the C++ programming language. Prerequisite: CMPE 046 with a grade of "C-" or better.'),
('Assembly Language Programming', 'CMPE102', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Assembly programming; assembly-C interface; CPU and memory organization; addressing modes; arithmetic, logic and branch instructions; arrays, pointers, subroutines, stack and procedure calls; software interrupts; multiplication, division and floating point arithmetic. Prerequisite: CMPE 050 or CS 046B (with grade of "C-" or better) Sophomore or upper division standing. Allowed Declared Majors: Computer Engineering, Software Engineering.'),
('Fundamentals of Software Engineering', 'CMPE104', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Measuring the software process, software process improvement. Lifecycle Models Design, Requirements Analysis. Validation and Verification. Conceptual Models in Logical languages. Formal Processes Methods. Prerequisite: CMPE 050 or CS 046B (with a grade of "C-" or better in either course ).');
INSERT INTO `courses` (`name`, `number`, `dName`, `cName`, `uName`, `description`) VALUES
('Electronics for Computing Systems', 'CMPE110', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'RC, RL and RLC circuit analysis, diodes and diode circuits, MOSFET and bipolar transistor I-V characteristics and circuits, TTL and CMOS logic circuits, CMOS-TTL interface, sensors and signal conditioning circuits using operational amplifiers, A/D and D/A converters, electromechanical device control. Prerequisite: EE 98, MATH 123; Computer Engineering and Software Engineering Majors Only. Misc Lab: Lecture 2 hours/lab 3 hours.'),
('Computer Organization and Architecture', 'CMPE120', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to computer organization and architecture, system buses, internal memory and external memory, input/output, central processing unit CPU, instruction sets, CPU structure and function, RISC, control unit. Prerequisite: CMPE 050 or CS 046B (with a grade of "C-" or better). Computer Engineering and Software Engineering Majors Only.'),
('Digital Design I', 'CMPE124', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Combinational and sequential logic theory and circuits. Emphasis on mixed logic and algorithmic state machines. Design projects using standard integrated circuit packages. Prerequisite: EE 97 and EE 98. Computer Engineering or Software Engineering Majors Only. Corequisites: CMPE 110 Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Digital Design II', 'CMPE125', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Digital system building blocks, data path and control units, system-level RTL design, Verilog HDL for design and verification, contemporary design flow and methodology, lab experiments using industry standard CAD tools and field programmable gate array (FPGA) devices. Prerequisite: CMPE 124 (with grade of "C-" or better). Computer Engineering or Software Engineering Majors Only. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Algorithms and Data Structure Design', 'CMPE126', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Object-oriented data organization and representation as strings, arrays, stacks, queues, dequeues, lists, sets, trees, tables, and graphs. Sorting and searching and algorithm design and performance analysis. Prerequisite: CMPE 050 (with a grade of "C-" or better), ENGR 010. Computer Engineering or Software Engineering Majors Only. Misc/Lab: Lecture 2 hours/Lab 2 hours.'),
('Microprocessor Design I', 'CMPE127', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Microprocessor architecture and assembly language. Design of peripheral blocks and their interfaces to the microprocessor. Design projects using standard integrated circuit packages. Prerequisite: Computer Engineering or Software Engineering Majors Only. Pre/Corequisite: CMPE 125 Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Advanced Algorithm Design', 'CMPE130', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design and analysis of data structures and algorithms. Advanced tree structures, hashing, searching and sorting. Divide-and-conquer, greedy and dynamic programming algorithm design techniques. Prerequisite: CMPE 126, ISE 130 (with grades of "C-" or better). Computer Engineering or Software Engineering Majors Only.'),
('Software Engineering I', 'CMPE131', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Why software engineering? What is software engineering? Software development lifecycle activities: project planning and management requirements analysis, requirement specification. Software design, software testing, verification, validation, and documentation. Software quality assurance and review techniques, software maintenance, team-based projects. Prerequisite: For CMPE Major: CMPE126 with a grade of "C-" or better. Allowed Declared Majors: Any Engineering For SE Majors: CS 046B with a grade of "C-" or better.'),
('Information Security', 'CMPE132', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'A study of computer and network security from centralized systems to distributed networks. Cryptology, vulnerabilities and controls. Firewalls, privacy enhanced e-mail, viruses and worms. Case studies will be featured. Prerequisite: CMPE 126. Computer Engineering or Software Engineering Majors Only.'),
('Software Engineering II', 'CMPE133', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Software Architecture, Software Technical Metrics, evaluating products, processes, and resources, improving predictions, products, processes, and resources. Advanced topics such as: Formal Methods, Software Reuse, Reengineering, Client/Server Software Engineering, Computer-Aided Software Engineering, Team-Based Projects. Prerequisite: CMPE 131 (with a grade of "C-" or better). Computer Engineering or Software Engineering Majors Only. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Object-Oriented Analysis and Design', 'CMPE135', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Feasibility analysis and system requirements determination, object-oriented design methodology, and information systems design using object-oriented modeling techniques. Emphasis on both theoretical and practical aspects of object-oriented systems analysis and design. Team-based design project. Prerequisite: For SE Majors: CS 046B or for others CMPE 126. See SJSU Catalog for detail list of prerequisites'),
('Information Engineering', 'CMPE136', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Major topics include computer-based information systems, electronic commerce, database management, network management, mobile computing, reengineering concepts, virtual office, knowledge-base systems artificial intelligence, expert systems, Computer-Aided Software/Systems Engineering (CASE). Prerequisite: ENGR 100W (with a grade of "C" or better), CMPE 131, CMPE 135.'),
('Wireless Mobile Software Engineering', 'CMPE137', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Mobility analysis, design principles, techniques, and methods for software systems on a variety of wireless and mobile Internet based computing and communication platforms, such as advanced pocket/tablet PCs, GPS, Bluetooth, Infrared, Wi-Fi, and RFID. Design multi-disciplined mobile project. Prerequisite: CMPE 131. Computer Engineering or Software Engineering Majors Only.'),
('Database Systems I', 'CMPE138', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'File organization and storage structure, database system architecture, entity relationship model, normalization techniques, SQL, relational algebra, storage organization, query processing, and concurrency control. Prerequisite: CMPE 126 (with a grade of "C-" or better). Computer Engineering or Software Engineering Majors Only.'),
('Fundamentals of Data Mining', 'CMPE139', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to data management and data mining, data preprocessing, OLAP and data warehousing, frequent pattern mining and association rules, clustering, classification, web mining, web search, recommender systems, social network analysis. Pre-requisites: CMPE 126 or CS 146 (with C- or better). Computer Engineering or Software Engineering Majors Only.'),
('Computer Architecture and Design', 'CMPE140', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Pipelining and timing issues in CPU data-paths. Principles of RISC-type CPU instruction set and architecture. Structural, data and control hazards in a RISC processor, forwarding loops, branch mechanisms. Memory architectures in CPUs such as register files and caches. Prerequisite: CMPE 125 (with grade of "C-" or better), Computer Engineering or Software Engineering Majors Only. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Operating Systems Design', 'CMPE142', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Overview: history, concepts, system calls and structures. Management of major components: processes, memory, input/output and files. Design of system calls and device drivers for hardware dependence. Concepts of kernel and shell, file protection and interactive computation. Prerequisite: CMPE 102, CMPE 126 (all with grades of "C-" or better). Computer Engineering or Software Engineering Majors Only. Corequisite: CMPE 130 (with grades of "C-" or better).'),
('Microcomputer Design', 'CMPE143', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Microcomputer architecture using modern microprocessors and related integrated circuits: clock subsystem, BUS drivers, map decoders, R/W memory, ROM, serial and parallel I/O, DMA, interrupt. Prerequisite: CMPE 127 (with a grade of "C-" or better). Misc/Lab: Lecture 2 hours/lab 3 hours. Notes: Offered only occasionally.'),
('Real-Time Embedded System Co-Design', 'CMPE146', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Embedded system architecture with real-time operating system including microcontrollers, interfacing techniques for industrial applications using transducers, sensors, and A/D-D/A converters. Hardware/software integration and codesign. Prerequisite: CMPE 110 and CMPE 127 with grade of "C-" or better. Computer Engineering or Software Engineering Majors Only. Misc/Lab: Lecture 2 hrs/lab 3 hrs.'),
('Fundamentals of System on Chip (SoC) Design', 'CMPE147', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'System on Chip implementation of a computing system. Implementation of parallel and serial bus architectures. SRAM, SDRAM and Flash memory interfaces. Direct Memory Access (DMA), interrupt controller, transceiver, timers and data converters. Verilog skills are required. Prerequisite: CMPE 125 (with "C-" or better). Computer Engineering or Software Engineering Majors Only.'),
('Computer Networks I', 'CMPE148', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Comparative evaluation of network architecture, layering model, standards, protocol examples for ISO and TCP/IP layers. Network applications, transport layer protocols, Internet routing, data link and physical transmissions. Applications in world wide web, file transfer, electronic mail, peer-to-peer and other areas. Prerequisite: For CMPE major: CMPE 124 and CMPE 126; for SE major: CMPE 120 and CS 146; Computer Engineering or Software Engineering Majors Only.'),
('Computer Networks II', 'CMPE149', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Protocol design and simulation in local and metropolitan area networks. Prerequisite: CMPE 148. Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('System Architecture and Electronic Design for Robo', 'CMPE150', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design and architecture for generating autonomous and human-reliant robots, algorithm development for object perception, electronic design and system integration for cognitive and sensory capabilities of robots, mechanisms for actuation and mobility, fault diagnosis and self-calibration. Prerequisite: CMPE 110, CMPE 124'),
('Compiler Design', 'CMPE152', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Principles of lexical analysis, finite state automata and parsing; issues of variable declarations, variable types, control statements, function calls, nested scopes and efficient assembler target code. Prerequisite: CMPE 126, CMPE 102 (both with grade of "C-" or better). Misc/Lab: Lecture 2 hours/lab 3 hours.'),
('Introduction to Computer Graphics and Augmented Re', 'CMPE163', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to 2D and 3D vector and pixel graphics, 2D and 3D transformations, world to viewer transformation pipeline, perspective projection, hidden line and surface removal, decoration algorithm and texture mapping, integration of pixel graphics and augmented reality, and hands-on laboratories. Prerequisite: CMPE 127; ENGR 100W; MATH 123 or MATH 129A or EE 112. Corequisite: ENGR 100W'),
('Wireless Networks Architecture and Design', 'CMPE164', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Wireless Network Design and Architecture, including the communication theory, communication protocols, wireless processors and system level design, Based Band encoding and communications, IF/RF communications, error correction coding, and system level implementation. Prerequisite: CMPE 127 and CMPE 140.'),
('Software Engineering Process Management', 'CMPE165', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Integrated approach to managing development within small teams; including mission statement, synthesis of design concepts, tradeoff studies, risk assessment and the interactions encountered in the optimal design, development, manufacture and test of systems. Prerequisite: CMPE 133. Computer Engineering or Software Engineering Majors Only.'),
('Software Design Studio I', 'CMPE168', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced software requirements elicitation, analysis and documentation. Software architectural design. Software team process infrastructure. Technical management of software development teams and resource estimation to support appropriate levels of quality. Quality assurance planning and execution. Prerequisite: CMPE 133, CMPE 104, CMPE 138, CS 146, CS 157A or instructor consent. Co-requisite: CMPE 195A. Misc/Lab: Lecture 2 hours/Lab 3 hours.'),
('Enterprise Software Platforms', 'CMPE172', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to enterprise software systems. Covers network operating systems, DBMS, transaction monitors, groupware, distributed objects, system management and the Web. Covers standards such as J2EE, CORBA, SQL, JDBC, and HTTP; and emerging software technologies. Prerequisite: CMPE 142 or CS 149 with grade of ''C-'' or better. Computer Engineering or Software Engineering Majors Only.'),
('Digital Design Using Hardware Description Language', 'CMPE179', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See EE 179.'),
('Individual Studies', 'CMPE180', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Individual work in computer engineering. Prerequisite: Upper division standing and instructor consent. Not available to Open University Students.'),
('Software Quality Engineering', 'CMPE187', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Software testing and quality assurance engineering concepts, processes, models, criteria, and methods. Software unit testing, integration, function validation, system performance and reliability evaluation; Software security testing methods and tools; software quality management, control systems, standards, and evaluation metrics. Prerequisite: CMPE 131. Computer Engineering or Software Engineering Majors Only.'),
('Machine Learning for Big Data', 'CMPE188', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to machine learning and pattern recognition for big data analytics; machine learning concepts, theories, approaches, algorithms, and big data analytic applications; supervised learning unsupervised learning and learning theory. Pre-requisite: CMPE 126'),
('Special Topics in Computer Engineering', 'CMPE189', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in Computer Engineering. Content varies from semester to semester. Prerequisite: Instructor consent.'),
('Senior Design Project I', 'CMPE195A', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Comprehensive plan and preliminary design of a group computer/software engineering project; integration of knowledge in science, technologies and team processes; group written report and oral presentation; global and social issues in engineering; individual professional development plans. GE Area: S when taken as part of CMPE major sequence Corequisite: ENGR 195A Prerequisite: For CMPE Majors: CMPE 127; CMPE 130; CMPE 131; ISE 130 (all with a C- or better); ENGR 100W (with a grade of "C" or better); in good standing in the major and graduation application on file. For SE Majors: CMPE 131, ISE 130 or MATH 161A (with a grade of "C-" or better), ENGR 100W (all with a grade of "C" or better); in good standing in the major, graduation application on file. Note: Meets GE Areas S and V when course is taken in combination with: CMPE 195B, ENGR 195A and ENGR 195B'),
('Senior Design Project II', 'CMPE195B', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Implementation of group design project initiated in CMPE 195A; group oral presentation and written report; integrated global and social issues in engineering. GE Area: V when taken as part of CMPE major sequence Prerequisite: CMPE 195A (with grade of "C" or better). junior and senior only. Allowed Declared Majors: Computer Engineering, Engineering, Software Engineering. Corequisite: ENGR 195B Misc/Lab: Lab 9 hours. Note: Meets GE Areas S and V when course is taken in combination with: CMPE 195A, ENGR 195A and ENGR 195B'),
('Interdisciplinary Senior Project I', 'CMPE195C', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ENGR 195C.'),
('Interdisciplinary Senior Project II', 'CMPE195D', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ENGR 195D.'),
('Cooperative Education Project', 'CMPE197', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ENGR 197.'),
('Technology and Civilization', 'CMPE198', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See TECH 198.'),
('Computer Architecture', 'CMPE200', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computer design overview, processor instruction set architecture and microarchitecture, instruction-level parallelism, memory hierarchy, storage and I/O systems, multicore/multiprocessor and data/thread-level parallelism, introduction to parallel programming. Prerequisite: Classified graduate standing or graduate advisor consent. Computer Engineering or Software Engineering majors only.'),
('Software Systems Engineering', 'CMPE202', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Integrated approach to software design and development including requirements elicitation and analysis, system design and construction through studying multiple facets of software development processes, design methodologies, modeling approaches, and implementation techniques. Prerequisite: Classified graduate standing or instructor consent. Computer Engineering and Software Engineering majors only. Misc/Lab: Lecture 3 hours.'),
('Software Engineering Management', 'CMPE203', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Development of software systems from the perspective of project management within the dynamic and complex nature of software technologies and environments; development lifecycle, communications, team dynamics, planning, estimation, scheduling, risk analysis, metrics tracking, problem management, and configuration management. Prerequisite: Graduate standing or instructor consent. Computer Engineering or Software Engineering Majors only.'),
('Computer Network Design', 'CMPE206', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Network topology and queuing theory. The seven layers of the ISO reference model: physical, data link, network, transport, session, presentation and application. Example networks. Network design project. Prerequisite: Classified graduate standing or instructor consent.'),
('Network Programming and Application', 'CMPE207', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Development and implementation of networking software for building distributed applications. Application Programming Interfaces: BSD Sockets, Winsock, Remote Procedure Call and Middleware. Network programming project. Prerequisite: CMPE 206, or instructor consent.'),
('Network Architecture and Protocols', 'CMPE208', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'In-depth study of the principles and architecture of Internet protocols in current practice. Analysis of protocols of network, transport, and application layers. Topics will also cover emerging network architecture and protocols. Network analysis project.. Prerequisite: CMPE 206 or instructor consent.'),
('Network Security', 'CMPE209', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Network security protocols and applications, cryptography algorithms, authentication systems, intrusion detection, network attacks and defenses, system-level security issues, and how to build secure systems. Prerequisite: CMPE 206 or EE 281.'),
('Software-defined Networks and Network Functions Vi', 'CMPE210', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The course covers development and implementation of Software-defined Networks and Network Functions Virtualization for building programmable network applications. It includes their concepts with various use cases. Students conduct a network programming project related to SDN/NFV by using open source projects. Prerequisite: CMPE 206 (or equivalent graduate network courses) or instructor consent.'),
('System Verification', 'CMPE212', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to SoC system configuration and integration; on chip protocols; assertion based verification; code and functional coverage metrics; methodologies, tools, and environments for functional verification of special function blocks (IPs) and integrated SoC-based computer systems. Prerequisite: CMPE 200 and CMPE 264 or instructor consent.'),
('Parallel Processing', 'CMPE213', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Parallel processing hardware, software, and applications. State-of-the-art description of parallel architectures, communication operations, parallel programming models, parallel algorithms, and performance analysis. Prerequisite: Classified graduate standing or instructor consent.'),
('Human Computer Interaction', 'CMPE217', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ISE 217.'),
('HCI for Cyber Security', 'CMPE219', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ISE 219.'),
('System Software', 'CMPE220', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'System software overview, assemblers, macro-assemblers, loaders and linkers, compilers and operating systems. Design project. Prerequisite: Classified graduate standing or graduate advisor consent. Computer Engineering and Software Engineering Majors only.'),
('SOA Analysis and Design', 'CMPE221', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Service-oriented software development processes; service modeling, service-oriented analysis and design, service-oriented architecture (SOA) platforms and standards, SOA and Web services, software development tools, and group design projects. Prerequisite: CMPE 275 or instructor consent.'),
('Operating System Design', 'CMPE225', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Theory of operating systems: concepts, system calls, O/S structures, process management, input/output, memory management and file systems. Application of theory to a real operating system. Prerequisite: CMPE 142. Pre/Corequisite: CMPE 220.'),
('Database Systems', 'CMPE226', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Database architectures, technologies, and practices for enterprise systems that use structured, semi-structured, and unstructured data. Provides opportunities to research and acquire experience using modern and emerging concepts in relational and non-relational database theory and technologies. Prerequisite: CMPE 272 or instructor consent. Computer Engineering or Software Engineering majors only.'),
('Distributed Systems', 'CMPE227', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Motivation for distributed systems, communications issues in distributed computing, design issues and alternative computing models. Prerequisite: CMPE 220.'),
('Component-Based and Reuse-Driven Software Engineer', 'CMPE232', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in industrial object-oriented and reuse-driven software engineering, processes, software architecture, architectural style, organizing a reuse business, and industrial examples of systematic large-scale software reuse. Team-based projects. Prerequisite: ENGR 200W, CMPE 220, CMPE 221, CMPE 271or instructor consent.'),
('Multimedia System Design', 'CMPE234', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Multimedia software systems concepts and architecture. Topics include multimedia retrieval, representations, multimedia databases, geographic information systems. R-tree, video databases, and multimedia operating systems. Design of high performance media servers. Prerequisite: CMPE 142 and CMPE 220 or instructor consent.'),
('Mobile Software System Design', 'CMPE235', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Study of wireless-based software systems in design and engineering, underlying networks, infrastructures and frameworks, wireless security, mobile user security & privacy (i.e. biometric security), emergent mobile programming platforms and technologies (such as RFID/Barcode/NFC), mobile commerce and service application systems. Prerequisite: CMPE 220 or CMPE 202 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Mobile Web Application Systems', 'CMPE236', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Mobile web system concepts, technology, architectures, security, design methods, validation techniques; mobile platforms and enabled technologies, mobile cloud, database and access services; mobile app development and platform solutions. Prerequisite: CMPE 202 or instructor consent.'),
('Design of E-Commerce Systems', 'CMPE237', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Current e-commerce concepts, business models, electronic transaction processing, e-commerce security problems and solutions, e-commerce systems and components, electronic auctions and negotiation, trading methods, business framework for e-commerce applications, and web advertising and marketing. Prerequisite: CMPE 271 and CMPE 220 or CMPE 202.'),
('Agent-Oriented Enterprise Software Engineering', 'CMPE238', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Key concepts of agent-oriented enterprise software engineering, agent technologies, multi-agent systems, software agents and workflows for enterprise application system engineering. Industrial examples. Team-based projects. Prerequisite: ENGR 200W, CMPE 220, CMPE 221, or instructor consent.'),
('Web and Data Mining', 'CMPE239', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Data mining and Web mining, data preprocessing, association rules and sequential patterns, classification, clustering, Web crawling, information retrieval and search engines, social network analysis, link analysis, ranking, Web usage mining, Web personalization and recommender systems, advanced topics. Prerequisites: CMPE 272 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Advanced Computer Design', 'CMPE240', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Architecture of a computing system including system bus, memory subsystems and peripherals. Unidirectional and bidirectional bus architectures. SRAM, SDRAM and FLASH memories. Design of DMA, interrupt controller, transmitter/receiver, timer, display adapter, A/D and D/A converters and other system peripherals. Design of memory and peripheral bus interfaces. Prerequisite: CMPE 127 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Embedded System Development Tools', 'CMPE241', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics dealing with embedded system development software tools, including system monitors, macro assemblers, in-circuit emulators, simulators, cross compilers, cross assemblers and interpreters. Prerequisite: CMPE 240 or instructor consent.'),
('Embedded Hardware Design', 'CMPE242', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics dealing with microprocessor and microcontroller hardware and firmware including processor architecture, advanced memory and I/O systems design, multilevel bus architecture, interrupt systems. Design project. Prerequisite: CMPE 200 or EE 275'),
('Embedded Systems Applications', 'CMPE243', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Embedded system interfacing techniques; peripheral devices; discussion of industrial, telecommunication, automotive, medical, and consumer applications of embedded systems. Design project. Prerequisite: CMPE 242 or instructor consent.'),
('Embedded Software', 'CMPE244', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Experiments dealing with advanced embedded software programming concepts, interfacing techniques, hardware organization and software development using an embedded systems. Individual projects. Prerequisite: CMPE 200, CMPE 220 or instructor consent.'),
('Embedded Wireless Architecture', 'CMPE245', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Embedded Wireless architecture with basic communication protocols, hands on labs with state of the art embedded system development tools. Prerequisites: CMPE 240 or instructor consent.'),
('Computerized Robots', 'CMPE250', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Evolution of computerized robots, overview of robot applications, robot system elements, artificial intelligence, pattern recognition, computer controlled functions, robot controllers, survey of computerized robot products and future trends in robot technology. Prerequisite: Classified standing or instructor consent.'),
('Software Techniques in Robotics', 'CMPE251', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Discussion of software methods in robotics, robot programming languages, robot architecture and operating systems, robot interfacing and robot task software. Extensive software projects dealing with robots. Prerequisite: CMPE 250 or instructor consent.'),
('Advanced Bioinformatics Computational Laboratory F', 'CMPE253', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ENGR 253.'),
('Real Time Computer System', 'CMPE261', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Applications of real time computer systems in different fields; characteristics, hardware and software aspects of real time systems; design of real time systems; application programs, files, databases and operating systems for real time systems; testing and debugging of real time systems. Prerequisite: CMPE 240.'),
('Embedded Multimedia Architecture', 'CMPE262', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Embedded RISC architecture for portable video, graphics processing engine, 2D/3D graphics module development, texture mapping, animation, H264 implementation, streaming and delivery, embedded multimedia servers, Linux OS and Web technology for wed based multimedia applications are investigated. Pre/Corequisite: CMPE 242.'),
('Advanced Digital and Computing System Design', 'CMPE264', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in register-transfer-level design of complex digital functional blocks, application-specific instruction set processors, and system-level integration/validation using Verilog/VHDL/C-level hardware description languages. Prerequisite: CMPE 200 or instructor consent.'),
('High Speed Digital System Design', 'CMPE265', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to high speed interface design techniques and analyzing high speed circuits utilizing latest modeling and simulation tools to provide necessary knowledge for the printed circuit board layout. Prerequisite: CMPE 200 or instructor consent.'),
('Information Engineering', 'CMPE270', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ISE 270.'),
('Advanced Java Programming', 'CMPE271', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Language, environment tools for Mobile Object Application Construction; object-oriented software engineering principles and practices highlighting mobile objects design and performance; laboratory applications and applets with Java IDE. Prerequisite: High-level language. Misc/Lab: Lecture 3 hours.'),
('Enterprise Software Platforms', 'CMPE272', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Enterprise software, system and virtualized platforms. Covers OSs, NOS, security, databases (OLTP, Big Data, Analytics), transactions, groupware, components, web services, web, systems management and app development. Covers standards and emerging technologies. Prerequisite: Classified graduate standing or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Enterprise Distributed Systems', 'CMPE273', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to application protocols for large scale distributed systems including object request brokers, asynchronous messaging, and Web services. Lab is based on using protocols to build distributed systems. Prerequisites: Java programming or instructor consent. Computer Engineering and Software Engineering majors only. Corequisites: CMPE 272'),
('Business Intelligence Technologies', 'CMPE274', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'This course covers technologies that are key to delivering business intelligence to an enterprise. The goal of business intelligence is to analyze and mine business data to understand and improve business performance by transforming business data into information into knowledge. Prerequisite: CMPE 272 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Enterprise Application Development', 'CMPE275', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Distributed component design, scalability, messaging, and integration practices for modern and emerging architectures and technologies. Prerequisite: CMPE 273 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('XML for E-Business', 'CMPE276', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'XML technologies for enabling e-business. Covers XML, (Namespaces), DTD, XML Schema, (DTD and XSD), XML APIs (SAX and DOM) XML languages (XPath, XPointer, and XSLT), and XML databases (XQuery). Lab is based on Xerces/Xalan, DTC/XSD, SAX/DOM, and XSDLT. Prerequisite: CMPE 273. Corequisite: CMPE 275 or instructor consent.'),
('Smartphone Application Development', 'CMPE277', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Architectures, technologies, and programming concepts for developing smartphone applications. Covers current smartphone/tablet OSs, application development, and deployment environments. Prerequisites: Classified graduate standing or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Advanced Enterprise Components', 'CMPE278', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Server-side component construction on the J2EE application server platform focusing on the use of design patterns and advanced technologies. Includes UML modeling, database, user interface design, component testing, packaging and installation, and J2EE clustering. Team development is emphasized. Prerequisite: CMPE 275.'),
('Software Security Technologies', 'CMPE279', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The course provides the fundamental concepts, methods and tools used to design and implement software security technologies for constructing trustworthy centralized, distributed or enterprise-wide software systems. Prerequisite: CMPE 220 or CMPE 202 or instructor consent.'),
('Web UI Design and Development', 'CMPE280', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Web User-interface (UI) design and development with contemporary web standards. Understand interaction and interface design principles and processes for rich web applications, mobile web, web graphics, web design fundamentals, tools, interaction using client side scripting and server side frameworks. Pre-requisite: Classified graduate standing or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Cloud Technologies', 'CMPE281', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Cloud computing concepts, evolution, architectures, infrastructures, opportunities, risks, enterprise adoption strategies, standards and polices, Software-as-a-Service (SaaS), Platform-as-a-Service (PaaS), Infrastructure-as-a-Service (IaaS), modern cloud computing technologies and tools, case studies and team projects. Corequisites: CMPE 272 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Cloud Services', 'CMPE282', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Cloud service architecture and layering, administrative issues, resiliency and security considerations; business development, operations and business support service, case studies and team projects. Prerequisites: CMPE 281 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Virtualization Technologies', 'CMPE283', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Virtualization concepts, components and infrastructure, hardware and software virtualization, virtualization machine life cycle management, virtualization services, case studies and team projects. Prerequisites: CMPE 272 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Storage and Network Virtualization', 'CMPE284', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Network and storage technologies, network virtualization and storage virtualization, including virtual local area networks, load balancers, firewalls, virtual private networks, network attached storage and storage area networks, case studies, and team projects. Prerequisites: CMPE 283 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Software Engineering Processes', 'CMPE285', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Software system development with emerging software engineering processes and technologies; planned and agile development processes, processes of Service-Oriented Architecture; component-based, Web-based, mobile based, event programming, wireless, user interface, and database access technologies. Corequisite: CMPE 202 or CMPE 220 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Advanced Software Engineering Processes', 'CMPE286', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Object-oriented analysis/design methodologies, tools and measures. A software maturity model used to explain the evolution of software processes. Advanced systems, networks and architectures. Prerequisite: CMPE 285 or instructor consent. Misc/Lab: Lecture 3 hours.'),
('Software Quality Assurance and Testing', 'CMPE287', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Software testing concepts, processes, models, criteria, and methods; software unit testing, integration, function validation, system performance measurement, and reliability evaluation; software security testing methods, assurance criteria, and validation tools; software security assurance process, standards, techniques, and case study. Prerequisite: CMPE 202 or instructor consent. Computer Engineering and Software Engineering majors only.'),
('Cloud Security Engineering', 'CMPE289', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Cloud security engineering concepts, issues, infrastructures, risks, enterprise adoption concerns; cloud security management, standards, criteria, processes, polices, regulations, identity and access management; security as a service and emergent security solutions and tools in clouds, case studies and team projects. Prerequisites: CMPE 272 or instructor consent'),
('Computer Engineering Research and Development Meth', 'CMPE290', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Discussion of research and development methods and current R&D topics in computer engineering. Selection of topics for individual projects. Literature search, intensive readings, discussions and reports. Completion of individual project plans. Prerequisite: CMPE 200.'),
('Int''l Program Studies', 'CMPE292', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'None'),
('Computer Engineering Seminar', 'CMPE294', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Provides graduate students with a background to conduct research, write proposals and present results in oral and written form. Prerequisite: Instructor consent.'),
('Cyber Security Seminar', 'CMPE294A', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Provides graduate students with the background and capability to conduct research and write technical reports in the area of cyber security Prerequisites: Instructor consent'),
('Graduate Laboratory', 'CMPE294L', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced laboratory in computer or software engineering to augment regularly-scheduled graduate courses and laboratories. Contents vary from semester to semester. May be repeated when content changes. Prerequisite: Instructor consent. Misc/Lab: Lab 3 hours.'),
('Master Project I', 'CMPE295A', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Comprehensive plan and preliminary design of a computer/software engineering project; integration of knowledge in technologies, processes and management to support program outcomes. Prerequisite: Classified status, good standing, completed 2 degree core courses, completed 2 courses in specialization, and graduate advisor consent. Misc/Lab: Lab 9 hours.'),
('Master Project II', 'CMPE295B', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Completion of an in-depth project to achieve the program outcomes and satisfy the cumulating experience; write a detailed project report; make a comprehensive presentation and demonstration. Prerequisite: CMPE 295A (with a B or better) or CMPE 295W (with a B or better), completed all degree core courses, admission to candidacy and graduate advisor consent. Misc/Lab: Lab 9 hours.'),
('Master Project', 'CMPE295W', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'In-depth developmental engineering work relating to problems of interest. Project includes proposal formulation, analysis, design, implementation, and testing. Prerequisites: Completed degree and specialization core requirements, classified status, in good standing and graduate advisor consent.'),
('Special Topics in Computer/Software Engineering', 'CMPE297', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Special topics to augment regularly-scheduled graduate courses. Prerequisite: Instructor consent.'),
('Special Problems', 'CMPE298', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced individual work in computer engineering. Prerequisite: Instructor consent. Not available to Open University Students.'),
('Computer/Software Engineering Internship', 'CMPE298I', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Field work for computer and software engineering graduate students. A report is required at the end of the semester addressing the goals set at the start of the assignment. Prerequisite: Completed 6 units degree core plus six additional degree program units, classified status, in good standing and graduate advisor consent'),
('Master Thesis I', 'CMPE299A', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The first part of a thesis culminating the work for the master''s degree in the specialization. Prerequisite: Completed core courses and classified status. Not available to Open University students.'),
('Master Thesis II', 'CMPE299B', 'Computer Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The second part of a thesis culminating the work for the master''s degree in the specialization. Prerequisite: Admission to Candidacy of Master Degree and CMPE 299A. Not available to Open University students.'),
