('Python Programming for Non Majors', 'CS022', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computer programming for non-Computer Science majors. Programming in interesting, relevant, and practical contexts. Image and video manipulation, digital music, databases, web pages, data analysis in the life sciences, other applications. Fundamental programming constructs:data structures and algorithms, iterations, functions.'),
('Introduction to Computer Science for Biologists an', 'CS023', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to computer science topics needed to enter the field of bioinformatics. Intended for Biology and Chemistry students. Simple C and Perl programming in a Unix environment and basic database access techniques will be covered. No prior knowledge of computer programming required. Prerequisite: BIOL 5 or CHEM 55; or instructor consent.'),
('The Digital World and Society', 'CS025', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See CMPE 025.'),
('Introduction to Computers', 'CS040', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'For students with little or no computer experience. Topics include: history of computing, user interfaces, computer applications, programming, hardware and software, computer networks.'),
('Introduction to Programming', 'CS046A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Basic skills and concepts of computer programming in an object-oriented approach using Java. Classes, methods and argument passing, control structures, iteration. Basic graphical user interface programming. Problem solving, class discovery and stepwise refinement. Programming and documentation style. Weekly hands-on activity. Prerequisite: Eligibility for Math 019 and a major of Computer Science, Software Engineering, or Undeclared; or instructor consent. Misc/Lab: Lecture 4 hour/lab 3 hours.'),
('Introduction to Data Structures', 'CS046B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Stacks and queues, recursion, lists, dynamic arrays, binary search trees. Iteration over collections. Hashing. Searching, elementary sorting. Big-O notation. Standard collection classes. Weekly hands-on activity. Prerequisite: Knowledge of Java equivalent to that obtained by completing CS 046A or CS 049J (with grade of "C" or better). Eligibility for MATH 030 or MATH 030P, or instructor consent. Math Remediation Completed or a post baccalaureate. Pre/Corequisite: MATH 42. Misc/Lab: Lecture 4 hour/lab 3 hours.'),
('Introduction to Computer Systems', 'CS047', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Instruction sets, assembly language and assemblers, linkers and loaders, data representation and manipulation, interrupts, pointers, function calls, argument passing, and basic gate-level digital logic design. Prerequisite: CS 46B (with a grade of "C-" or better)'),
('Programming in C', 'CS049C', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Beginning course in the C language. Prerequisite: Previous programming experience and completion of math GE.'),
('Programming in Java', 'CS049J', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to the Java programming language and libraries. Topics include fundamental data types and control structures, object-oriented programming, string processing, input/output, and error handling. Use of Java libraries for mathematics, graphics, collections, and for user interfaces. Prerequisite: Previous programming experience in a language other than Java.'),
('Scientific Computing I', 'CS050', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See METR 050.'),
('Unix and Unix Utilities', 'CS072', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'A practical introduction to Unix and Unix utilities. Topics include use of the major utilities, Unix file structure, interaction with the shell, graphical user interfaces and networking commands. This course is the first in the Unix Systems Administration Certificate Program. Prerequisite: CS 46A (with a grade of "C-" or better) or equivalent. Math Remediation Completed or a post baccalaureate.'),
('Practical Computing Topics', 'CS085A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format. Different versions of this course may be repeated for credit. Prerequisite: Varies with topic.'),
('Practical Computing Topics', 'CS085B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format. Different versions of this course may be repeated for credit. Prerequisite: Varies with topic.'),
('Practical Computing Topics', 'CS085C', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format. Different versions of this course may be repeated for credit. Prerequisite: Varies with topic. Math Remediation Completed or a post baccalaureate.'),
('Technical Writing Workshop', 'CS100W', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced writing through preparation of technical reports and presentations. Improving skills for writing subject-related reports, project proposals and personal resumes through practice and evaluation. Course assignments will be related to issues concerning careers in computer science. GE Area: Z Prerequisite: A3 or equivalent second semester composition course (with a grade of C- or better); Completion of core GE, satisfaction of Writing Skills Test and upper division standing. Note: Must be passed with C or better to satisfy the CSU Graduation Writing Assessment requirement (GWAR).'),
('Introduction to Game Studies', 'CS108', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See ART 108.'),
('Introduction to Computer Graphics', 'CS116A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Vector geometry, geometric transformations and the graphics pipeline. Basic raster graphics algorithms for drawing discrete lines, clipping, visible surface determination and shading. Display of curves and surfaces. Graphics data structures. Prerequisite: MATH 31, MATH 129A, CS 146 (with a grade of "C-" or better in each) and previous programming experience in C/C++, or instructor consent.'),
('Computer Graphics Algorithms', 'CS116B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'In-depth discussion of algorithms and techniques used in computer graphics and their implementation. Topics include: animation, fractals, anti-aliasing, fill algorithms, visible surface algorithms, color and shading, ray tracing, radiosity and texture maps. Substantial programming required. Prerequisite: CS 116A (with a grade of "C-" or better) or instructor consent. Notes: Offered only occasionally.'),
('Electronics, Data Acquisition & Analysis', 'CS120A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See PHYS 120A.'),
('Advanced Programming with Perl', 'CS122', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to the Perl programming language, with emphasis on data manipulation, file processing, and database access. Real-life applications in various fields such as system administration, networking, and bioinformatics. Prerequisite: CS 146 (with a grade of "C-" or better) or instructor consent.'),
('Bioinformatics I', 'CS123A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to the main public domain tools, databases and methods in bioinformatics. Analysis of algorithms behind the most successful tools, such as the local and global sequence alignment packages, and the underlying methods used in fragment assembly packages. Solution of complex biological questions requiring modification of standard code. Prerequisite: CS 23, and BIOL 115 or CHEM 130A; or CS 46B and a molecular biology course. Allowed Declared Majors: Computer Science, Biology'),
('Bioinformatics II', 'CS123B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computational methods used for searching, classifying, analyzing, and modeling protein sequences. Tools for analyzing DNA and RNA sequences. More advanced topics, such as genetic algorithms and simulated annealing, which can be used to address folding problems. Prerequisite: CS 123A.'),
('Windows Programming', 'CS130', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to the concepts and techniques of windows programming using the .NET Foundation Class Library (FCL) and C#. Topics include graphics programming, graphical user interface programming, current technology for code reuse (components), and programmatic access to web services. Prerequisite: CS 46B (with a grade of "C-" or better), or instructor consent.'),
('Computer Game Design and Programming', 'CS134', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Architectures and object-oriented patterns for computer game design. Animation, simulation, user interfaces, graphics, and intelligent behaviors. Team projects using an existing game engine framework. Prerequisite: CS 146 and either CS 151 or CMPE 135 (with a grade of "C-" or better in each); or instructor consent.'),
('Numerical Analysis and Scientific Computing', 'CS143C', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See MATH 143C.'),
('Numerical Analysis and Scientific Computing', 'CS143M', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See MATH 143M.'),
('Advanced C++ Programming', 'CS144', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced features of C++, including operator overloading, memory management, templates, exceptions, multiple inheritance, RTTI, namespaces, tools. Prerequisite: CS 46B and CS 49C (with a grade of C- or better in each), or equivalent knowledge of object-oriented programming and C, or instructor consent.'),
('Data Structures and Algorithms', 'CS146', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Implementations of advanced tree structures, priority queues, heaps, directed and undirected graphs. Advanced searching and sorting (radix sort, heapsort, mergesort, and quicksort). Design and analysis of data structures and algorithms. Divide-and-conquer, greedy, and dynamic programming algorithm design techniques. Prerequisite: MATH 030, MATH 042, CS 049J (or equivalent knowledge of Java), and CS 046B (with a grade of "C-" or better in each); Computer Science, Applied and Computational Math or Software Engineering Majors only; or instructor consent.'),
('Computer Architecture', 'CS147', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to the basic concepts of computer hardware structure and design, including processors and arithmetic logic units, pipelining, and memory hierarchy. Prerequisite: CS 47 or CMPE 102 (with a grade of "C-" or better), Computer Science, Applied and Computational Math, or Software Engineering majors only; or instructor consent.'),
('Operating Systems', 'CS149', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Fundamentals: Contiguous and non-contiguous memory management; processor scheduling and interrupts; concurrent, mutually exclusive, synchronized and deadlocked processes; files. Substantial programming project required. Prerequisite: CS 146 or SE 146 (with a grade of "C-" or better). Computer Science, Applied and Computational Math or Software Engineering Majors only; or Instructor Consent'),
('Object-Oriented Design', 'CS151', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design of classes and interfaces. Value and reference semantics. Object-oriented design methodologies and notations. Design patterns. Reflection and serialization. Exception handling. Graphical user interface programming. Frameworks and components. Multithreading. Required team-based programming assignment. Prerequisite: MATH 42, CS 46B, and CS 49J (or equivalent knowledge of Java) (with a grade of "C-" or better in each); Computer Science, Applied and Computational Math or Software Engineering majors only; or instructor consent.'),
('Programming Paradigms', 'CS152', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Programming language syntax and semantics. Data types and type checking. Scope, bindings, and environments. Functional and logic programming paradigms, and comparison to other paradigms. Extensive coverage of a functional language. Prerequisite: CS 151 or CMPE 135 (with a grade of "C-" or better); Computer Science, Applied and Computational Math or Software Engineering Majors only; or instructor consent.'),
('Concepts of Compiler Design', 'CS153', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Theoretical aspects of compiler design, including parsing context free languages, lexical analysis, translation specification and machine-independent code generation. Programming projects to demonstrate design topics. Prerequisite: CS 47 or CMPE 102, CS 146, and CS 154 (with a grade of "C-" or better in each); Computer Science, Applied and Computational Math or Software Engineering majors only; or instructor consent.'),
('Formal Languages and Computability', 'CS154', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Finite automata, context-free languages, Turing machines, computability. Prerequisite: MATH 42 and CS 46B (with a grade of "C-" or better in each); Computer Science, Applied and Computational Mathematics, or Software Engineering, majors only; or instructor consent.'),
('Introduction to the Design and Analysis of Algorit', 'CS155', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Algorithm design techniques: dynamic programming, greedy algorithms, Euclidean and extended Euclidean algorithms, Discrete and Fast Fourier transforms. Analysis of algorithms, intractable problems and NP-completeness. Additional topics selected from: selection algorithms and adversary arguments, approximation algorithms, parallel algorithms, and randomized algorithms. Prerequisite: CS 146 (with a grade of "C-" or better) or instructor consent.'),
('Introduction to Artificial Intelligence', 'CS156', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Basic concepts and techniques of artificial intelligence: problem solving, search, deduction, intelligent agents, knowledge representation. Topics chosen from logic programming, game playing, planning, machine learning, natural language, neural nets, robotics. Prerequisite: CS 146 and either CS 151 or CMPE 135 (with a grade of "C-" or better in each); or instructor consent.'),
('Introduction to Database Management Systems', 'CS157A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Current, classical database systems. Entity-relationship and enhanced entity models. Relational model, algebra, calculus. Current, emerging SQL standard. Embedded, Dynamic SQL. Application perspective on transactions and security. Interactive and programmatic interfaces to database systems. Application programming project using commercial database system. Prerequisite: CS 146 (with a grade of "C-" or better); Computer Science, Applied and Computational Math, or Software Engineering majors only; or instructor consent.'),
('Database Management Systems II', 'CS157B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Survey course. Object-oriented data model, definition language, query language. Object relational database systems. Database trends like active, temporal, multimedia, deductive databases. Web database topics, namely, architectures, introduction to interface languages. Team projects. Prerequisite: CS 157A (with a grade of "C-" or better); Computer Science, Applied and Computational Math, or Software Engineering Majors only; or instructor consent.'),
('Computer Networks', 'CS158A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to computer networks, including network layered architectures, local and wide area networks, mobile wireless networks, Internet TCP/IP protocol suite, network resource management, network programming, network performance, network security, network applications. Prerequisite: CS 146, and CS 147 or CMPE 120, (with grades of "C-" or better in each); or instructor consent.'),
('Computer Network Management', 'CS158B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Principles and technologies of network management: reference models, functions (fault, configuration, performance, security and accounting management), management information, communication protocols, integration, and assessment. Network security and cyber defense: cryptography, key distribution, authentication protocols, network attacks, access control, and example systems. Prerequisite: CS 158A or CMPE 148 (with a grade of "C-" or better), or instructor consent'),
('Introduction to Parallel Processing', 'CS159', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Major parallel architectures: shared memory, distributed memory, SIMD, MIMD. Parallel algorithms: techniques for scientific applications, measures of performance. Parallel programming: principles and implementations in various languages. Assignments on available parallel and vector computers. Prerequisite: CS 146 (with a grade of "C-" or better); Computer Science, Applied and Computational Math, or Software Engineering Majors only; or instructor consent.'),
('Software Engineering', 'CS160', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Software engineering principles, software process and process models, requirements elicitation and analysis, design, configuration management, quality control, project planning, social and ethical issues. Required team-based software development, including written requirements specification and design documentation, oral presentation, and tool use. Prerequisite: CS 146, CS 151 (with a grade of "C-" or better in each); CS 100W (with a grade of "C" or better) or instructor consent. Computer Science and Software Engineering Majors only.'),
('Software Project', 'CS161', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'A substantial project based on material from an advanced area of computer science. Includes lectures on the project topic and the design and testing of software systems. At least 50% of the course grade to be based on the project. Prerequisites: CS 160 (with a grade of "C-" or better) or instructor consent. Computer Science and Software Engineering Majors only.'),
('Information Security', 'CS166', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Fundamental security topics including cryptography, protocols, passwords, access control, software security, and network security. Additional topics selected from multilevel security, biometrics, tamper-resistant hardware, information warfare, e-commerce, system evaluation and assurance, and intrusion detection. Prerequisite: CS 146 (with a grade of "C-" or better) and either CS 47 or CMPE 102 or CMPE 120 (with a grade of "C-" or better); Computer Science, Applied and Computational Math, or Software Engineering Majors only; or instructor consent.'),
('DB2 Fundamentals for z/OS', 'CS167A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Overview of the DB2 database systems for z/OS, including DB2 anatomy, application development with DB2, system administration for DB2, and performance issues in DB2 on the enterprise platform. Hands-on labs included. Prerequisites: CS 146 (with a grade of ''C-'' or better) or instructor consent.'),
('DB2 Application Development for z/OS', 'CS167B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Application interfaces for DB2 such as embedded SQL, ODBC, CLI, JDBC, SQLJ, and pureQuery. Preparation, execution, and advanced SQL functions of DB2 applications. Service-oriented architecture and data web services. Current industrial applications. Hands-on labs included. Prerequisites: CS 157A or CS 167A (with a grade of "C-" or better in each), or instructor consent.'),
('DB2 Query Optimization for z/OS', 'CS167C', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Overview of query processing including query transformation, runtime environments, and predicate application. Discussion of access paths, optimizer statistics, and access path selection. Query performance monitoring and tuning with industrial tools. Hands-on labs included. Prerequisites: CS 157A or CS 167A (with a grade of "C-" or better in each), or instructor consent.'),
('Fundamentals of Unix System Administration', 'CS172A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Basic tasks for Unix systems administration including system installation, administration of user accounts, file system installation and maintenance, backups, process management and introduction to shell scripting. Second course in Unix Systems Administration Certificate Program. Prerequisite: CS 72 (with a grade of "C-" or better).'),
('Unix System Administration', 'CS172B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Topics include external device configuration, introduction to Perl programming, file and disk management, log files, script writing for common tasks, troubleshooting, TCP/IP and routing fundamentals, NFS and security. Third course in Unix Systems Administration Certificate program. Prerequisite: CS 172A (with a grade of "C-" or better).'),
('Advanced Unix System Administration', 'CS173', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'System performance management including tuning to enhance performance. Network administration including NIS, DNS, email. Disk management including RAID. Large scale administration including software distribution and routine task automation. Required for Unix Systems Administration Certificate Level 2. Prerequisite: CS 172B (with a grade of "C-" or better).'),
('Server-side Web Programming', 'CS174', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Development and deployment of multi-tier web-based applications. Introduction to HTML, XML, enterprise design patterns, web services and database access. Prerequisite: CS 46B (with a grade of "C-" or better); Computer Science, Applied and Computational Math, or Software Engineering Majors only.'),
('Mobile Device Development', 'CS175', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Mobile Platform APIs including those for networking, touch, graphics, data, location, and camera. Testing and profiling on devices and emulators/simulators. Prerequisites: CS 047, and knowledge of Java equivalent to that of CS 046A or CS 049J'),
('Individual Studies', 'CS180', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Individual study in a specific field. Prerequisite: Department chair consent. Not available to Open University Students'),
('Individual Studies for Honors', 'CS180H', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Senior project on advanced topics in computer science as determined by the instructor. Written paper or oral presentation of the project required. Intended for students graduating with departmental honors. Prerequisite: At least junior standing as computer science major. GPA of 3.5 or higher in the major and department chair consent.'),
('Advanced Practical Computing Topics', 'CS185A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format and may be repeated for credit.. Prerequisite: Varies with topic.'),
('Advanced Practical Computing topics', 'CS185B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format and may be repeated for credit. Prerequisite: Varies with topic.'),
('Advanced Practical Computing Topics', 'CS185C', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Computing topics of current interest in industrial practice. Emphasis on effective use and integration of software/hardware. Different topics may be offered at different times in a short-course lecture/lab format and may be repeated for credit. Prerequisite: Varies with topic.'),
('Internship Project', 'CS190', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Work on an approved semester-long paid project at an industrial site. Meet once per week on campus. Progress reports, oral presentations, final report, and evaluation by project supervisor will be used to demonstrate the acquisition of skills identified as goals prior to the start of the assignment. Prerequisite: CS 146 (with a grade of "C-" or better) or graduate standing, selection by a company, and instructor consent'),
('Internship Project', 'CS190I', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Work on an approved semester-long paid project at an industrial site. Meet once per week on campus. Progress reports, oral presentations, final report, and evaluation by project supervisor will be used to demonstrate the acquisition of skills identified as goals prior to the start of the assignment. Prerequisite: CS 146 (with a grade of "C-" or better) or graduate standing, selection by a company, and instructor consent.'),
('Graduate Technical Writing', 'CS200W', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Graduate technical writing workshop to develop advanced communication skills that will meet the professional needs of computer scientists, along with research methodologies and proper documentation for the master''s thesis project. (This course does NOT satisfy the undergraduate GE Area Z requirement.) Prerequisite: Graduate standing.'),
('Geometric Modeling', 'CS216', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Representation of curves and surfaces, basic differential geometry, solid modeling fundamentals, implementation considerations. Prerequisite: CS 116A or instructor consent.'),
('Topics in Cloud Computing', 'CS218', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Topics in cloud computing, including distributed system models, virtual machines, virtualization, cloud platform architectures (IaaS, PaaS, SaaS), service-oriented architectures, cloud programming and software environments, peer-to-peer computing, ubiquitous cloud, cloud security and trust management. Prerequisite: CS 149'),
('Bioinformatics', 'CS223', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'The course investigates the main algorithms for solving computational problems in bioinformatics. Methods will include Hidden Markov Models for gene prediction and protein profiling, and Genetic Algorithms for biological sequence analysis and structure prediction. Students will be given programming projects. Prerequisite: CS 123A or CS 155.'),
('User Interface Design', 'CS235', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Human-computer interaction principles. Direct manipulation, focus plus context, interaction history; interfaces for websites and website collections; usability testing; role of metaphors; case studies; advanced topics include information visualization, interfaces for collaboration, intelligent interfaces, and software agents. Prerequisite: CS 130 or CS 116A, or instructor consent.'),
('Advanced Software Project', 'CS240', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'A semester-long project, assigned by the instructor. Class discussion of project issues, including software design methodologies, applicable algorithms/data structures and system interfaces. Prerequisite: Classified standing in MSCS program, and either CS 100W or concurrent enrollment in CS 100W.'),
('Advanced Numerical Analysis', 'CS243A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See MATH 243A.'),
('Advanced Topics in Numerical Analysis', 'CS243B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'See MATH 243B.'),
('Advanced Computer Architecture', 'CS247', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in vector architectures, including: pipelined architectures, dataflow computers, VLSI architectures, butterfly connections; bus and memory architectures; cache structures; hardware implementations of algorithms. Prerequisite: CS 147 and CS 149 or instructor consent.'),
('Distributed Computing', 'CS249', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Current issues in operating systems, including multiprocessor systems and distributed computing, networks, security and performance. Case studies of current operating systems. Prerequisite: CS 149 or instructor consent.'),
('Object-Oriented Analysis', 'CS251A', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Emphasizes the important concepts, activities, and artifacts of the analysis phase of object-oriented software development. CASE tools and UML are used to model application domain data, workflows, system requirements, deployment, and life cycles. Prerequisite: CS 160 or instructor consent.'),
('Object-Oriented Design', 'CS251B', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Course covers important concepts, activities, and artifacts of the design phase of object-oriented software development. Topics include design metrics, design patterns, refactoring, frameworks, and testing. Prerequisite: CS 160 or instructor consent.'),
('Advanced Programming Language Principles', 'CS252', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Language design and paradigms, including concepts underlying functional, logic, object-oriented and parallel paradigms. Theoretical foundations, including lambda calculus, denotational and axiomatic semantics. Proofs of program correctness. Programming projects emphasizing different aspects of language design. Prerequisite: CS 152 or instructor consent.'),
('Advanced Compiler Design', 'CS253', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Review of attribute analysis and static semantic evaluation. Runtime environments and code generation. Basic blocks and flow graphs. Register allocation and storage classes. Common subexpression elimination and constant propagation. Loop optimizations. Global data flow analysis. Completion of a code optimization project. Prerequisite: CS 153 or instructor consent.'),
('Theory of Computation', 'CS254', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Models of computation; decidability; complexity measures; hierarchies; P, NP and other complexity classes; intractable problems. Prerequisite: CS 154 or instructor consent.'),
('Design and Analysis of Algorithms', 'CS255', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Randomized algorithms. Parallel algorithms. Distributed algorithms. NP-completeness of particular problems. Approximation algorithms. Prerequisite: CS 155 or instructor consent.'),
('Topics in Artificial Intelligence', 'CS256', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Introduction to topics in artificial intelligence such as problem solving methods, game playing, understanding natural languages, pattern recognition, computer vision and the general problem of representing knowledge. Students will be expected to use LISP. Prerequisite: CS 156 or instructor consent.'),
('Database System Principles', 'CS257', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design management and performance issues on: file organization and access methods, buffer management and storage management. Query processing and query optimization, transaction management, recovery, and concurrency control techniques. Reliability, protection and integrity techniques. Extensive programming project. Prerequisite: CS 157B or instructor consent.'),
('Computer Communication Systems', 'CS258', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design, analysis and survey of the latest advancements in network and Internet technologies, such as supporting TCP/IP over various network media, software-defined networks, networks supporting cloud computing, network security, peer-to-peer and overlay networks, and quality of services. Prerequisite: CS 158A or instructor consent.'),
('Advanced Parallel Processing', 'CS259', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'An advanced hardware architecture and software development class focused on multi-threaded, parallel processing algorithms and techniques. A study of high-performance parallel hardware architectures and parallel programming languages. Applications of parallel and GPU processing, including computer gaming.'),
('Randomized Algorithms and Applications', 'CS262', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Design and analysis of algorithms which incorporate randomness in their design. Applications will be given in several of the following areas: data structures, pattern matching, cryptography, parallel computing, distributed computing, and interactive proof systems. Prerequisite: CS 154 or CS 155.'),
('Information Security I', 'CS263', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Selected security topics in cryptography and access control. Prerequisite: CS 149 or instructor consent'),
('Information Security II', 'CS264', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Selected security topics in security protocols and software. Prerequisite: CS149 and CS265, or instructor consent'),
('Cryptography and Computer Security', 'CS265', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Security mechanisms for protecting information in computer systems and networks. Includes cryptography and its applications to security services in distributed systems, mathematics of cryptography, access control, protection models, security policies, design of secure systems, firewalls, and intrusion detection. Prerequisite: CS 149 or instructor consent.'),
('Topics in Information Security', 'CS266', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in the area of information security. Content differs with each offering. Possible topics include, but are not restricted to: Network Security, Software Reverse Engineering and Cryptanalysis. Prerequisite: CS 166 or instructor consent.'),
('Topics in Database Systems', 'CS267', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in the area of database and information systems. Content differs in each offering. Possible topics include though not restricted to: Data Mining, Distributed Databases and Transaction Processing. Prerequisite: CS 157B.'),
('Topics in Wireless Mobile Networking', 'CS268', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Advanced topics in the area of wireless mobile networking. Content may differ in each offering. Possible topics include though not restricted to: wireless local and metropolitan area networks, mobile Internet, sensor networks, mobile computing, wireless network security. Repeatable when topic changes. Prerequisite: CS 158A.'),
('Topics in XML and Web Intelligence', 'CS274', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'XML: DTD, Schema, Namespace, XSLT, XPath, Xquery, Encryption, Signature in XML, applications in vertical industries; Semantic Web; RDF, RDFS, Ontology, Inferences; Web services, relevant tools for search, inference, data conversion in XML, Semantic web applications. Prerequisites: CS 160 or instructor consent.'),
('Graduate Individual Studies', 'CS280', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Individual study in specific field. Prerequisite: Department chair consent. Not available to Open University Students'),
('Advanced Topics in Computer Science', 'CS286', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Selected topics in computer science. Topics vary each semester and may be repeated for a maximum of 6 units. Prerequisite: Suitable upper division background in mathematics and computer science as set by instructor.'),
('Preparation for Writing Project or Thesis', 'CS297', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Supervised individual research and project work to prepare for a master''s writing project or thesis. Prerequisite: Fully classified standing in the MSCS program, department chair consent. Not available to Open University Students. Pre/Co-requisite: CS 200W'),
('Master''s Writing Project', 'CS298', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Prerequisite: CS 297 or CS 240, and department chair consent and admission to candidacy for the MS degree. Not available to Open University Students.'),
('Master''s Thesis', 'CS299', 'Software Engineering', 'Charles W. Davidson College of Engineering', 'San Jose State University', 'Prerequisite: CS 297 and department chair consent and admission to candidacy for the MS degree. Not available to Open University Students.'),
